import Button from "@material-ui/core/Button";
import React from "react";

function PaginationBar() {
  return (
    <div>
      <Button variant="contained" color="primary">
        Hello World
      </Button>
      Pagination The Pagination component enables the user to select a specific
      page from a range of pages. themes Premium Themes. Kickstart your
      application development with a ready-made theme. ad by Material-UI Basic
      pagination … … … …
      <Pagination count={10} />
      <Pagination count={10} color="primary" />
      <Pagination count={10} color="secondary" />
      <Pagination count={10} disabled />
      Outlined pagination … … … …
      <Pagination count={10} variant="outlined" />
      <Pagination count={10} variant="outlined" color="primary" />
      <Pagination count={10} variant="outlined" color="secondary" />
      <Pagination count={10} variant="outlined" disabled />
    </div>
  );
}

export default PaginationBar;
